import axios from "axios";
import { GET_LEADS } from "./types";

//Get Leads 

export const getLeads = () => dispatch => {
    axios
        .get('http://127.0.0.1:8000/api/post-list')
        .then(res => {
            dispatch({
                type: GET_LEADS,
                payload: res.data
            });
        }).catch(err => console.log(err));
}
